var title_f30_26_31145="Adenocarcinoma in small biopsy and cytology";
var content_f30_26_31145=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F79343&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F79343&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 532px\">",
"   <div class=\"ttl\">",
"    Adenocarcinoma in small biopsy and cytology",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 512px; height: 391px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Poorly differentiated non-small cell carcinoma, favor adenocarcinoma.",
"    <br>",
"     (A) This core biopsy shows a solid pattern of growth, and morphologically, it lacks any acinar, papillary, or lepidic patterns. The mucin stain was also negative.",
"     <br>",
"      (B) The TTF-1 stain is strongly positive.",
"      <br>",
"       (C) The p63 stain is very focally positive. The strongly and diffusely positive TTF-1 and only focal p63 staining favor adenocarcinoma. In this case, EGFR mutation was positive.",
"       <br>",
"        (D) Cytology from different adenocarcinoma shows large malignant cells with abundant cytoplasm and prominent nuclei growing in an acinar structure.",
"        <div class=\"footnotes\">",
"         EGFR: epidermal growth factor receptor; TTF: thyroid transcription factor.",
"        </div>",
"        <div class=\"reference\">",
"         Reproduced with permission from: Travis WD, Brambilla E, Noguchi M, et al. International Association for the Study of Lung Cancer/American Thoracic Society/European Respiratory Society International Multidisciplinary Classification of Lung Adenocarcinoma. J Thorac Oncol 2011; 6:244. Copyright &copy; 2011 Lippincott Williams &amp; Wilkins.",
"        </div>",
"       </br>",
"      </br>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
