var title_f30_26_31147="Bone density definitions PI";
var content_f30_26_31147=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PI%2F74669&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PI%2F74669&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Definitions of normal bone density, osteopenia, and osteoporosis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        T-score",
"       </td>",
"       <td class=\"subtitle1\">",
"        Bone density",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        +1 to -1",
"       </td>",
"       <td class=\"subtitle2_left\">",
"        Normal bone density",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Bone density that is between 0 and 1 standard deviation below the mean is considered to be normal. This may be reported as a T-score of +1 to -1. Treatment is not usually recommended for people with normal bone density, although preventive measures (eg, calcium supplements, weight-bearing exercise) are recommended to prevent osteopenia and osteoporosis.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        1 to -2.4",
"       </td>",
"       <td class=\"subtitle2_left\">",
"        Osteopenia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Bone density that is between 1 and 2.5 standard deviations below the mean is called osteopenia. This may be reported as a T-score of -1 to -2.4. A person with osteopenia does not yet have osteoporosis, but is at risk of developing it if not treated.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        -2.5 or less",
"       </td>",
"       <td class=\"subtitle2_left\">",
"        Osteoporosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Osteoporosis is defined as BMD more than 2.5 standard deviations (SD) below the mean of normal young women. This is reported as a T-score of -2.5 or less. The lower the bone density, the greater the risk of fracture.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    The World Health Organization (WHO) has defined normal bone density as a value within one standard deviation (SD) from average peak bone mass. Standard deviation is a statistical measure that defines how much a patient's result varies from the \"average\" young adult.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
